/*
This function takes a vector l and returns a vector l' such that
l' is identical to l in the odd indicies, while its values at the even indicies are equal
to the values of the even indicies of l, but sorted.
>>> sort_even({1, 2, 3})
{1, 2, 3}
>>> sort_even({5, 6, 3, 4})
{3, 6, 5, 4}
*/
#include<stdio.h>
#include<math.h>
#include<vector>
#include<algorithm>
using namespace std;
vector<float> sort_even(vector<float> l){
    vector<float> l_prime = l;
    vector<float> even_values;

    // Extract even values from l
    for(int i=0; i<l.size(); i+=2){
        even_values.push_back(l[i]);
    }

    // Sort even values
    sort(even_values.begin(), even_values.end());

    // Replace even values in l_prime with sorted even values
    int even_index = 0;
    for(int i=0; i<l_prime.size(); i+=2){
        l_prime[i] = even_values[even_index];
        even_index++;
    }

    return l_prime;
}
