#include <queue>
#include <bits/stdc++.h>

/*
Return 2^n modulo p (be aware of numerics).
>>> modp(3, 5)
3
>>> modp(1101, 101)
2
>>> modp(0, 101)
1
>>> modp(3, 11)
8
>>> modp(100, 101)
1
*/
#include<stdio.h>
using namespace std;
int modp(int n,int p){
    if (n == 0) {
        return 1;
    } else {
        long long result = 1;
        long long base = 2;
        n = n % (p - 1); // Using Fermat's Little Theorem
        while (n > 0) {
            if (n % 2 == 1) {
                result = (result * base) % p;
            }
            n = n / 2;
            base = (base * base) % p;
        }
        return result;
    }
} 


#undef NDEBUG
#include<assert.h>
int main(){
    assert (modp(3, 5) == 3);
    assert (modp(1101, 101) == 2);
    assert (modp(0, 101) == 1);
    assert (modp(3, 11) == 8);
    assert (modp(100, 101) == 1);
    assert (modp(30, 5) == 4);
    assert (modp(31, 5) == 3);
}

