false
*/
#include<stdio.h>
#include<string>
#include<algorithm>
using namespace std;
bool same_chars(string s0,string s1){
    // Sort both strings
    sort(s0.begin(), s0.end());
    sort(s1.begin(), s1.end());

    // Check if both strings are equal after sorting
    return s0 == s1;
}


#undef NDEBUG
#include<assert.h>
