>>> largest_prime_factor(13195)
29
>>> largest_prime_factor(2048)
2
*/
#include<stdio.h>
using namespace std;
int largest_prime_factor(int n){
    int i;
    int largest_prime = 2;

    while (n % 2 == 0) {
        n = n / 2;
    }

    for (i = 3; i <= n; i = i + 2) {
        while (n % i == 0) {
            largest_prime = i;
            n = n / i;
        }
    }

    return largest_prime;
}


