brazilian_factorial(n) = n! * (n-1)! * (n-2)! * ... * 1!
where n > 0

For example:
>>> special_factorial(4)
288

The function will receive an integer as input and should return the special
factorial of this integer.
*/
#include<stdio.h>
using namespace std;
long long special_factorial(int n){
    long long result = 1;
    for(int i = n; i > 0; i--){
        long long factorial = 1;
        for(int j = i; j > 0; j--){
            factorial *= j;
        }
        result *= factorial;
    }
    return result;
}


#undef NDEBUG
