compare_one(1, 2.5) ➞ 2.5
compare_one(1, "2,3") ➞ "2,3"
compare_one("5,1", "6") ➞ "6"
compare_one("1", 1) ➞ "None"
*/
#include<stdio.h>
#include<string>
#include<algorithm>
#include<boost/any.hpp>
using namespace std;
boost::any compare_one(boost::any a,boost::any b){
    if(a.type() == typeid(int) && b.type() == typeid(int)){
        int int_a = boost::any_cast<int>(a);
        int int_b = boost::any_cast<int>(b);
        if(int_a > int_b){
            return int_a;
        } else if(int_b > int_a){
            return int_b;
        } else {
            return "None";
        }
    } else if(a.type() == typeid(float) && b.type() == typeid(float)){
        float float_a = boost::any_cast<float>(a);
        float float_b = boost::any_cast<float>(b);
        if(float_a > float_b){
            return float_a;
        } else if(float_b > float_a){
            return float_b;
        } else {
            return "None";
        }
    } else if(a.type() == typeid(string) && b.type() == typeid(string)){
        string string_a = boost::any_cast<string>(a);
        string string_b = boost::any_cast<string>(b);
        double double_a = stod(string_a);
        double double_b = stod(string_b);
        if(double_a > double_b){
            return string_a;
        } else if(double_b > double_a){
            return string_b;
        } else {
            return "None";
        }
    } else {
        return "Invalid input types";
    }
}


