/*
Write a function which sorts the given vector of integers
in ascending order according to the sum of their digits.
Note: if there are several items with similar sum of their digits,
order them based on their index in original vector.
    If an integer is negative, then its first digit will be negative:
    e.g. -123 has digits -1, 2, and 3.

For example:
>>> order_by_points({1, 11, -1, -11, -12}) == {-1, -11, 1, -12, 11}
>>> order_by_points({}) == {}
*/
#include<stdio.h>
#include<math.h>
#include<vector>
#include<string>
using namespace std;
vector<int> order_by_points(vector<int> nums){
    // Function to calculate the sum of digits of a number
    int sum_of_digits(int num) {
        int sum = 0;
        while (num != 0) {
            sum += abs(num % 10);
            num /= 10;
        }
        return sum;
    }

    // Custom comparator function for sorting based on sum of digits and index
    auto comp = [&](int a, int b) {
        int sum_a = sum_of_digits(a);
        int sum_b = sum_of_digits(b);
        if (sum_a == sum_b) {
            return find(nums.begin(), nums.end(), a) < find(nums.begin(), nums.end(), b);
        }
        return sum_a < sum_b;
    };

    // Sorting the vector using the custom comparator
    sort(nums.begin(), nums.end(), comp);

    return nums;
}
#undef NDEBUG
#include<assert.h>
bool issame(vector<int> a,vector<int>b){
    if (a.size()!=b.size()) return false;
    for (int i=0;i<a.size();i++)
    {
    if (a[i]!=b[i]) return false;
    }
    return true;
}
