    for(string s : lst){
        if(s.length() % 2 == 0){
            filtered_lst.push_back(s);
        }
    }

    // Sort the filtered list by length and then alphabetically
    sort(filtered_lst.begin(), filtered_lst.end(), [](const string &a, const string &b){
        if(a.length() == b.length()){
            return a < b;
        }
        return a.length() < b.length();
    });

    return filtered_lst;
}
